import React from 'react';
import { Form, Input, Label } from 'semantic-ui-react';

const TournamentFormComponent = () => {

    const [percentCooperateAgent, setPercentCooperate] = React.useState(0)
    const onClick = (event) => {
        console.log(event)
    }

    return <Form>
        <Form.Group widths='equal'>
            <Form.Field>
                <Input
                    min={0}
                    max={100}
                    onChange = {setPercentCooperate}
                    defaultValue = {percentCooperateAgent}
                />
            </Form.Field>
        </Form.Group>
        <Form.Button type='submit' onClick = {onClick}>Load Tournament Visual</Form.Button>
    </Form>

}

export default TournamentFormComponent;
